CREATE DEFINER=`root`@`localhost` PROCEDURE `score`(in crs_id int, in cr_id int, in ace_id int, in cul_id int)
BEGIN
    declare b double;
    declare c double;
    declare d double;
    declare e double;
    declare cri_p double;
    declare eve_p double;
    declare over_p double;


    set b = (select sum(Cr_Computed) from criteria_score);
    set eve_p = (select EC.Category_Per from Cultural_Events CE inner join Event_Category EC on CE.Cul_ID = EC.Cul_ID inner join Criteria_Cultural CC on EC.Category_ID = CC.Category_ID where CE.Cul_ID = cul_id group by CE.Cul_ID);
    set c = (b * eve_p);


    insert into cultural_overall_score values (c,ace_id);

    set d = (select sum(COS_TotalScore) from  cultural_overall_score);
    set over_p = (select CE.Cul_Percentage from cultural_events where CE.Cul_ID = cul_id);

    set e = d * over_p;

    insert into results values (id, e);

END$$

--
-- Functions
--
CREATE DEFINER=`root`@`localhost` FUNCTION `fun_sumcri`(ace_id int) RETURNS double
BEGIN
     declare sum_ni double;
     set sum_ni = (select sum(Cr_Computed) from criteria_score where ACE_ID = ace_id);
     return sum_ni;
END$$

